import { useHistory } from "react-router-dom";
import { DatosPersonales } from '../components/pacientes/DatosPersonales';
import { Tabs } from '../components/pacientes/Tabs';
import { useParams } from 'react-router-dom';

export const Paciente = (props) => {
    let history = useHistory()
    const { rut } = useParams()
    const {paciente} = props


    return (
        <div className='container-fluid mt-5 pad'>
            <div className = "row">
                <div className="col-12">
                    <DatosPersonales paciente = {paciente} params = {rut}/>
                </div>
            </div>
            <div className="row d-gridjustify-content-center">
                <div className="col">
                    <button className="btn btn-primary">Ficha Clinica</button>                    
                </div>
